export class Categories extends Component {
  constructor(props) {
    super(props)
    this.state = {
      categories: [
        {
          key: 'all',
          name:'Все'
        },
        {
          key: 'chairs',
          name:'Стулья'
        },
        {
          key: 'tabless',
          name:'Столы'
        },
        {
          key: 'light',
          name:'Светильники'
        },
        {
          key: 'sofa',
          name:'Диваны'
        },
      ]
    }

  }
  render() {
    return (
      <div>Categories</div>
    )
  }
}

export default Categories
